Certainly! Here's an example of how you might represent the abstract syntax tree (AST) of the Metal Shading Language using Swift structs:

```swift
enum DataType {
    case void
    case bool
    case int
    case uint
    case float
    case double
    case vector(type: DataType, size: Int)
    case matrix(type: DataType, rows: Int, columns: Int)
    case struct_(name: String)
    case array(type: DataType, size: Int)
    case sampler
    case texture(type: DataType, dimension: Int)
}

struct VariableDeclaration {
    let dataType: DataType
    let name: String
    let initialValue: Expression?
}

struct FunctionDeclaration {
    let returnType: DataType
    let name: String
    let parameters: [VariableDeclaration]
    let body: CompoundStatement
}

